import Image from "./Image.js";
import { StaticImages } from "./Image.js"
import React from 'react';
import { Helmet } from 'react-helmet';

export default function App() {
  let christmas_pepe=
  {
    name: 'Christmas Pepe',
    url: 'https://external-content.duckduckgo.com/iu/?u=http%3A%2F%2Findiater.com%2Fwp-content%2Fuploads%2F2018%2F12%2Ffree-merry-christmas-wishes-animated-video-and-greetings-after-effect-template.gif&f=1&nofb=1',
    width: 300,
    height: 300,
    top: '50%',
    left: '50%'
  };

  return (
    <div>
      <Helmet><style>{'body { background-color: lightblue; }'}</style></Helmet>
      <Image icon={christmas_pepe}/>
      <StaticImages/>
    </div>
  );
}
